description:
Olwen Griffiths

Sociopolitical Documentary hosted by Dai Jones, published by S4C broadcasted as part of S4C Cefn Gwlad series in 2003 - Welsh narration


Information
------------------------------

Dai Jones, Llanilar visits Olwen Griffiths who runs a monumental stonemason business in Pwllheli. Although Olwen is over seventy, she continues to do the hard, physical work the job demands and Dai has a job keeping up with this sprightly lady. During her working day, Olwen leads us to picturesque locations on the Llyn Peninsula, such as Aberdaron, Trefor and Nefyn.

